import axios from "axios";

// eslint-disable-next-line
const signupPost = async (body) => {

    axios({
        method: 'post',
        url: 'http://food-power.glitch.me/sign-up',
        headers: {},
        data: body
    })
        .then(function (response) {
            return response.data;
        });

    return response.data;
};



export default signupPost;
